import React from "react";
import "./SideBar.css";
import ReactDom from "react-dom";

const SideBar = (props) => {
  const sideBarContent = <div className="side-bar">{props.children}</div>;

  return ReactDom.createPortal(
    sideBarContent,
    document.getElementById("side-bar")
  );
};

export default SideBar;
